  true,\n\t\"url\": null,\n\t\"notes\": \"Search for pending and resolved NPDES withdrawal
  petitions by state, region, date, or keyword.  \"Pending\" means EPA has received
  the petition and is working with the state and petitioner to resolve it. \"Withdrew
  petition\" means that the petitioner has withdrawn the petition they submitted.
  \"Resolved\" means that EPA has resolved the issues raised in the petition and has
  denied the petition. \"Partially resolved\" means that EPA has partially denied
  the petition by resolving some of the issues, while continuing to work with the
  state and petitioner on other pending issues. \"Program withdrawn\" would apply
  if, after conducting investigations, EPA withdrew a state's NPDES authority.\",\n\t\"license_title\":
